// frontend/src/theme.js
import { createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#d50909',  // JLL Red
    },
    secondary: {
      main: '#000000',  // Black
    },
    background: {
      default: '#ffffff',  // White
    },
  },
});

export default theme;
